    uint public minimum;
    uint public maximum;

    function demo() public {
        minimum = type(uint8).min;
        maximum = type(uint8).max;
    }

    // unsigned integers
    // uint8 - uint256
    uint public myUint = 42;

    // 2 ** 256
    uint8 public mySmaillUint = 2;
    // 2 ** 8 = 256
    // 0 ---> (256-1)

    function demo(uint _inputUint) public {
        uint localUint = 42;
        localUint + 1;
        localUint - 1;
        localUint * 2;
        localUint / 2; // int
        localUint ** 3;
        localUint % 3;
        -myInt;

        localUint == 1;
        localUint != 1;
        localUint > 1;
        localUint >= 1; 
        // ...

    }

    // signed integers
    int256 public myInt = -42;
    int8 public mySmallInt = -1;
    // 2 ** 7 = 128

    // there is no float

    bool public myBool = true; // state

    // 0xd9145CCE52D386f254917e481eB44e9943F39138
    address public owner;

    constructor () {
        owner = msg.sender;
    }

    function payForItem () public payable {
        payments[msg.sender] = msg.value;
    }

    function withdrawAll () public {
        address payable _to = payable(owner);
        address _thisContract = address(this);
        _to.transfer(_thisContract.balance);
    }

    function myFunc (bool _inputBool) public {
        bool localBool = false; // local
